angular.module("DribbbleApp",["infinite-scroll"]).controller("PostListController ",function(s){var t=this;t.busy=!1,t.page=0,t.posts=[],t.nextPage=function(){t.busy=!0,t.page++,s.get("http://api.dribbble.com/shots/popular?page="+t.page).success(function(s){for(var o=0;o<s.shots.length;o++)t.posts.push(s.shots[o]);t.busy=!1})},t.nextPage()});